import React from 'react'
import './SideBarDrop.css'
import SideItem from './SideItem'
import { NavItems } from '../../data/NavItemData'

const SideBarDrop = () => {
  return (
    <div style={sideNavStyle}>
      <h2>Side Navigation</h2>
      {NavItems.map((navItem,index)=>{
        return <SideItem key={index } items={navItem}/> 
      })}
    </div>
  )
}

const sideNavStyle={
    height:"100vh",
    width:"350px",
    background:"rgb(55,82,131)",
    background:
    "linear-gradient(135deg,rgba(55,82,131,1) 0%, rgba(20,96,194,10))",
    position:"absolute",
    border:"1px solid transparent",
    left:0,
    textAlign:"left",
}

const headerStyle={
    fontWeight:"600",
    padding:"0px 20px"
}

export default SideBarDrop
